Sure! Here's a simple HTML template for a website to showcase your Instagram crafts page. You can customize it further as needed.

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Crafts By YourInstagramHandle</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f9f9f9;
            color: #333;
        }
        header {
            background-color: #8B4513; /* Brown theme */
            color: white;
            padding: 20px 0;
            text-align: center;
        }
        header h1 {
            margin: 0;
            font-size: 2.5em;
        }
        nav {
            background-color: #A0522D; /* Slightly lighter brown */
            padding: 10px;
            text-align: center;
        }
        nav a {
            color: white;
            margin: 0 15px;
            text-decoration: none;
            font-weight: bold;
        }
        nav a:hover {
            text-decoration: underline;
        }
        .container {
            max-width: 1200px;
            margin: 20px auto;
            padding: 20px;
            background-color: white;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }
        .craft-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
            gap: 15px;
            margin-top: 20px;
        }
        .craft-item img {
            width: 100%;
            border-radius: 10px;
        }
        footer {
            background-color: #8B4513;
            color: white;
            text-align: center;
            padding: 10px 0;
            margin-top: 20px;
        }
        footer a {
            color: #FFD700; /* Gold color for links */
            text-decoration: none;
        }
        footer a:hover {
            text-decoration: underline;
        }
    </style>
</head>
<body>
    <header>
        <h1>Crafts By YourInstagramHandle</h1>
    </header>
    <nav>
        <a href="#about">About</a>
        <a href="#gallery">Gallery</a>
        <a href="#contact">Contact</a>
    </nav>
    <div class="container">
        <section id="about">
            <h2>About Me</h2>
            <p>Welcome to my crafting world! I’m a passionate crafter who loves creating unique and beautiful handmade items. Follow me on Instagram for daily inspiration, tutorials, and updates on my latest projects.</p>
            <p><a href="https://www.instagram.com/yourinstagramhandle/" target="_blank">Follow me on Instagram!</a></p>
        </section>
        <section id="gallery">
            <h2>Gallery</h2>
            <div class="craft-grid">
                <div class="craft-item">
                    <img src="craft1.jpg" alt="Craft Project 1">
                </div>
                <div class="craft-item">
                    <img src="craft2.jpg" alt="Craft Project 2">
                </div>
                <div class="craft-item">
                    <img src="craft3.jpg" alt="Craft Project 3">
                </div>
                <div class="craft-item">
                    <img src="craft4.jpg" alt="Craft Project 4">
                </div>
                <!-- Add more images as needed -->
            </div>
        </section>
        <section id="contact">
            <h2>Contact</h2>
            <p>Have questions or want to collaborate? Feel free to reach out via Instagram or email!</p>
            <p>Email: <a href="mailto:youremail@example.com">youremail@example.com</a></p>
        </section>
    </div>
    <footer>
        <p>&copy; 2025 Crafts By YourInstagramHandle | Follow me on <a href="https://www.instagram.com/yourinstagramhandle/" target="_blank">Instagram</a></p>
    </footer>
</body>
</html>
```

### Steps to Use:
1. Replace `yourinstagramhandle` with your actual Instagram handle.
2. Replace `youremail@example.com` with your email address.
3. Replace the image file names (`craft1.jpg`, `craft2.jpg`, etc.) with your actual craft project images.
4. Upload additional images to the same folder as your HTML file or update the paths accordingly.

This template is mobile-friendly and uses a warm brown theme to give it a cozy, crafty vibe. Let me know if you'd like further customization or additional features! 🎨✨

